helpers.global.shuffle = function(array) {
    var i, j, temp;
    i = array.length - 1;
    while (i > 0) {
        j = Math.floor(Math.random() * (i + 1));
        temp = array[i];
        array[i] = array[j];
        array[j] = temp;
        i--;
    }
    return array;
};

